def finding_differences_between_strings(seq1=str, seq2=str):
    contador = 0
    for indice, item in enumerate(seq1):
        if item != seq2[indice]:
            contador += 1
    return contador

def dividing_strings_in_sequences(string_bruta = str):
    lista_limpa = []
    lista_dividida = string_bruta.strip().split("\n")
    for index, item in enumerate(lista_dividida):
        lista_limpa.append(item.strip())
    return lista_limpa

texto = """


"""
lista_tratada = dividing_strings_in_sequences(texto)
resposta = finding_differences_between_strings(lista_tratada[0], lista_tratada[1])
print(resposta)

